import React, { Component } from 'react';
import styled from 'styled-components';
import './App.css';

const Title = styled.h1`
  text-align: center
`;

class App extends Component {
  render() {

    // Create the Encode Image Button
    const encoderButton = (
      <input
        type="button"
        value="Encode Image"
      />
    );

    // Create the Decode Image Button
    const decoderButton = (
      <input
        type="button"
        value="Decode Image"
      />
    );

    let buttons = (<div>{encoderButton} {decoderButton}</div>)


    return (
      <div className="App">
        <Title>Steganography Project - The Encoder</Title>
        {buttons}
      </div>
    );
  }
}

export default App;
